	add("ancestry", "{\"term\":\"ancestry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027ancesserie\u0027 See ancestor.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Condition as to ancestors; ancestral lineage; hence, birth or honorable descent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Title and ancestry render a good man more illustrious, but an ill one more contemptible. -Addison\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A series of ancestors or progenitors; lineage, or those who compose the line of natural descent.\u0026lt;!-- material copied from Webster\u0027s Revised Unabridged Dictionary (1913) --\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

