	add("anchor", "{\"term\":\"anchor\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) \u0027ancor\u0027 () \u0027ancra\u0027 () from Latin \u0027ancora\u0027 () from (or cognate with) Ancient greek (to 1453) \u0027ἄγκυρα\u0027 from Proto-indo-european {{m|ine-pro|*ang-||corner, hirn}}. The modern spelling is a sixteenth-century modification to better represent the Latin misspelling \u0027anchora\u0027. Related to Dutch \u0027anker\u0027 (anchor) {{attention|en|hypercorrection?}}The verb comes from Middle english (1100-1500) \u0027anker\u0027 probably from Middle dutch (ca. 1050-1350) verb of \u0027anker\u0027 from Old french (842-ca. 1400) \u0027ancrer\u0027 from Latin \u0027ancora\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tool used to moor a vessel to the bottom of a sea or river to resist movement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Formerly a vessel would differentiate amongst the anchors carried as \u0027waist anchor\u0027, \u0027best bower\u0027, \u0027bower\u0027, \u0027stream\u0027 and \u0027kedge\u0027 anchors, depending on purpose and, to a great extent, on mass and size of the anchor. Modern usage is \u0027storm anchor\u0027 for the heaviest anchor with the longest rode, \u0027best bower\u0027 or simply \u0027bower\u0027 for the most commonly used anchor deployed from the bow, and \u0027stream\u0027 or \u0027lunch hook\u0027 for a small, light anchor used for temporary moorage and often deployed from the stern\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An iron device so shaped as to grip the bottom and hold a vessel at her berth by the chain or rope attached. (FM 55-501\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dMen that I knew around Wapatomac didn\u0027t wear high, shiny plug hats, nor yeller spring overcoats, nor carry canes with ivory heads as big as a catboat\u0027s \u0027\u0027anchor\u0027\u0027, as you might say\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The combined anchoring gear (anchor, rode, and fittings such as bitts, cat, and windlass\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any instrument serving a purpose like that of a ship\u0027s anchor, such as an arrangement of timber to hold a dam fast; a device to hold the end of a bridge cable etc.; or a device used in metalworking to hold the core of a mould in place\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A marked point in a document that can be the target of a hyperlink\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An anchorman or anchorwoman\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The final runner in a relay race\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A point that is touched by the draw hand or string when the bow is fully drawn and ready to shoot\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A superstore or other facility that serves as a focus to bring customers into an area\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0027Planning: For the Natural and Built Environment\u0027 (issues 1650-1666, page 15\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Supermarkets have also had to adjust. Tesco, Sainsbury\u0027s and Asda have put a much greater emphasis on developing smaller high street stores or becoming \u0027\u0027anchors\u0027\u0027 for mixed-used regeneration schemes\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"That which gives stability or security\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Bible, vi. 1\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"which hope we have as an \u0027\u0027anchor\u0027\u0027 of the sou\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A metal tie holding adjoining parts of a building together\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Carved work, somewhat resembling an anchor or arrowhead; part of the ornaments of certain mouldings. It is seen in the echinus, or egg-and-anchor (called also egg-and-dart, egg-and-tongue) ornament\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"One of the anchor-shaped spicules of certain sponges\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"One of the calcareous spinules of certain holothurians, as in species of \u0027Synapta\", \"priority\":20}]}, \"synonyms\":{}}");

