	add("anchorite", "{\"term\":\"anchorite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀναχωρητής\u0027 (anchoret) from \u0027ἀναχωρέω\u0027 (i withdraw, retire) via Latin {{m|la|anachorēta||anchorite}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who lives in isolation or seclusion, especially for religious reasons\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dThe preposterous altruism too!Resist not evil. It is an insane immolation of self—as bad intrinsically as fakirs stabbing themselves or \u0027\u0027anchorites\u0027\u0027 warping their spines in caves scarcely large enough for a fair-sized dog\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1950\u0027\u0027, \u0027The Age of Faith\u0027, Simon and Schuster, page 792\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"About 1150 some Palestinian \u0027\u0027anchorites\u0027\u0027 adopted the eremitical rule of St. Basil, and spread throughout Palestine; when the Moslems captured the Holy Land these \u0026quot;Carmelites\u0026quot; migrated to Cyprus, Sicily, France, and England\", \"priority\":4}]}, \"synonyms\":{}}");

