	add("ancilla", "{\"term\":\"ancilla\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027ancilla\u0027 (maid, slave-girl)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A maid\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Vladimir Nabokov, \u0027Ada or Ardor\u0027, Penguin 2011, p. 306\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘And pass me that towel,’ added Ada, but the \u0027\u0027ancilla\u0027\u0027 was picking up coins she had dropped in her haste\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An auxiliary or accessor\", \"priority\":4}]}, \"synonyms\":{}}");

